import React, {useReducer} from 'react';
import logo from './logo.svg';
function LoginPane(){
    return(
        <div className = 'login-card'>
            <img src = {logo} alt = "login-logo" className = "App-logo"/>
            <div>
                <label>Username:<input placeholder = "username"></input></label>
                <label>Password:<input type = "password" placeholder = "password"></input></label>
                <button>LOGIN</button><br/><br/>
                <label>Don't have an account yet?</label><br/><br/>
                <button>SIGNUP</button><br/>
            </div>
        </div>
    )
}




export default LoginPane;
